import './Competencias.css';

export default function Competencias(){

    let btn = "¡Sorpréndete!";
    let visible = false;

    const click = () => {
        if(btn === "¡Sorpréndete!"){btn="Cerrar"}
        else{btn = "¡Sorpréndete!"}
        visible = !visible;
    }

    return(
        <div className="competenciasContenedor">
            <div className='competenciasVideos'>
                <iframe id="video" width="400" height="225" src='https://www.youtube.com/embed/21X5lGlDOfg' title='La NASA en vivo' frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
                <iframe id="video" width="400" height="225" src="https://www.youtube.com/embed/DnrmpgKJPsY" title='Robots de Boston Dynamics' frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
                <iframe width="400" height="225" src="https://www.youtube.com/embed/_UTTGLB_UUU" title="Nuestro agujero negro" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>            </div>
            <div className='competenciasDescription'>
                <h1>¿Considera la proactividad una cualidad importante?</h1>
                {visible&&<h2>¡Yo sí! Aparte de ser proactiva, también me considero autodidacta, curiosa, perseverante, adaptable y apasionada!</h2>}
                <button onClick={click} id='btnCompetencias'>{btn}</button>
            </div>
        </div>
    )
}
